Magic: The Gathering - The Spell Thief 01-04 (2012|Digital|Nahga-Empire)

Promotional info - &quot;Planeswalker Dack Fayden has followed Sifa Grent into a mysterious plane, where a Titan's castle looms invitingly in the distance. Entering the castle in search of Sifa, Dack is soon imprisoned by the Titan and added to his vast collection. Dack must find a way out before the trail to Sifa runs cold and he remains the Titan's prisoner forever!&quot;

All copies of the four issues are digital thanks to Nahga-Empire. Please seed, and enjoy! :-)
